import React, { useState } from "react";
import Bird from "./Bird";
import Empty from "./Empty";

function ObjectCreatorBird({ objectIndex, onCollision }) {
    const [isPaused, setIsPaused] = useState(false);

    const handleCollision = () => {
        setIsPaused(true);
        setTimeout(() => {
            setIsPaused(false);
        }, 10000);
        onCollision();
    };

    const componentMap = {
        empty: {
            min: 501,
            max: 11999,
            component: <Empty />
        },
        bird: {
            min: 0,
            max: 500,
            component: <Bird />
        }
    };

    for (const key in componentMap) {
        const { min, max, component } = componentMap[key];
        if (objectIndex >= min && objectIndex <= max) {
            return isPaused ? <Empty /> : component;
        }
    }
}

export default ObjectCreatorBird;
